import React from 'react'
import Reel from './Reel';
import '../assets/css/App.css'

const Reels = (props) => {
    
    const reels = props.reels;


     return(
            reels.map((reel, index) => {
                return(
                        <Reel key={index} reel={reel}></Reel>
                );    
            })
            );
}

export default Reels;
